column17:
The following post uses a Distract tactic by discussing a completely different topic:
@EmmanuelMacron We will never forgive. The blood of our children is on the hands of everyone who is silent. #StopPutin! Stop the genocide of the Ukrainian people! Close the sky over Ukraine! #EU @NATO #StopRussia #StopPutin #ClosetheSkyoverUkraine

While the initial tweet mentions NATO, the subsequent tweets shift the focus to stopping Putin and the situation in Ukraine, which distracts from the original call to close the sky over Ukraine in relation to NATO. This tactic is used to bring attention to a different issue and potentially draw attention away from the original NATO-related message.
